description:
სასკოლო სახელმძღვანელოების 80% დაბეჭდილია და საქართველოს მასშტაბით არსებულ სკოლებში გადანაწილებული.
დღეს, საქართველოს განათლებისა და მეცნიერების მინისტრი თამარ სანიკიძე თბილისის სკოლებისთვის  სახელმძღვანელოების გადაცემის პროცესს დაესწრო. მინისტრი სკოლებში გასულ სასწავლო წელს გამოყენებული წიგნების ვარგისიანობით დაინტერესდა და ერთი მოსწავლისთვის განკუთვნილი წიგნების პაკეტსაც გაეცნო. 
პაკეტი ახალ წიგნებთან ერთად, მაღალი ქულებით შეფასებული, საუკეთესო მდგომარეობაში მყოფი წიგნებით არის დაკომპლექტებული და იგი ყველა მოსწავლეს გადაეცემა.
საქართველოს განათლებისა და მეცნიერების სამინისტრო 2013 წლიდან “მოსწავლეების სახელმძღვანელოებით უზრუნველყოფის პროგრამას“ ახორციელებს. 2014 წელს სახელმწიფო 509 651 მოსწავლეს აუმჯობესებული ხარისხის სახელმძღვანელოებსა  და სამუშაო რვეულებს უსასყიდლოდ   გადასცემს.
2014 წლის  მთავარი სიახლეები:
o შემცირდა სახელმძღვანელოების წონა; 
o გაუმჯობესებულია ქაღალდისა და საღებავის უვნებლობის ხარისხი;
o პირველი კლასის ყველა სახელმძღვანელო დაიბეჭდა თანამედროვე სპეციალურ საბეჭდ ქაღალდზე, რომელიც გამოირჩევა სიმსუბუქითა და გამძლეობით;
o თორმეტივე კლასის უსინათლო მოსწავლეები ბრაილის შრიფტით დაბეჭდილ სახელმძღვანელოებს მიიღებენ.

